-- Unit Descriptions

-- UEF -- Armored Commander Unit/Upgrades
Unit_Description_0303="Armored Commander is a combination of barracks and command center. Contains all the blueprints necessary to build a basic army from scratch. Upgradeable with combat enhancements, advanced engineering suits, resource allocation system, and teleporting."
Unit_Description_0056="The UEF Supreme Commander Description."
Unit_Description_0004="Mounts a Tactical Cruise Missile Launcher onto the back of the ACU."
Unit_Description_0005="Grants Tech 2 schematic access and increases the ACU's build speed and maximum health"
Unit_Description_0006="Increases the speed at which the ACU repairs itself."
Unit_Description_0007="Replaces the Tech 2 engineering Suite. Grants Tech 3 and Experimental schematic access and further increases the ACU's build speed and maximum health"
Unit_Description_0008="Doubles the ACU's main weapon damage, and increases its range and that of Overcharge."
Unit_Description_0009="Tactical Cruise Missiles replaced by much more expensive, powerful Tactical Nuclear Missiles."
Unit_Description_0010="Adds Teleportation capability. Requires considerable energy to activate."
Unit_Description_0011="Replaces the ACU's Personal Shield with a Bubble Shield which protects friendly units inside it. Requires additional energy to run."
Unit_Description_0012="Increases ACU's resource generation to 10 mass per second and 2500 energy per second."
Unit_Description_0013="Creates a protective Personal Shield around the ACU. Requires energy to run."
Unit_Description_0014="Creates an Engineering Drone which act as a flying T1 Engineer. Assists the ACU by default, but can be given its own orders."
Unit_Description_0015="Adds a second Engineering Drone."

-- UEF -- Support Commander Units/Upgrades
